import React from 'react'
import Logo from './Logo'

const FooterSectionOne = () => {
  return (
    <div>
      <div className="px-10 pt-20 pb-8">
        <Logo/>
    </div>
    </div>
  )
}

export default FooterSectionOne

const socials = [
    {media:'Instagram', link:'#', icon:'Ig'},
    {media:'LinkedIn', link:'#', icon:'In'},
    {media:'X', link:'#', icon:'X'},
    {media:'Youtube', link:'#', icon:'▷'}
]
